import React from "react";
import { Link } from "react-router-dom";

const ErrorPage = () => {
  return (
    <section className="error__page">
      <div className="center">
        <h2 className="h2">Page Not Found</h2>
        <Link to="/" className="btn primary">
          Go Back Home
        </Link>
      </div>
    </section>
  );
};

export default ErrorPage;
